Parsing an ObjectCreationExpr stores the type including the type arguments as type and nothing as typeArguments.

See following test:
``` Java
package javaparser;

import com.github.javaparser.JavaParser;
import com.github.javaparser.ParseResult;
import com.github.javaparser.ParserConfiguration;
import com.github.javaparser.ast.CompilationUnit;
import com.github.javaparser.ast.expr.ObjectCreationExpr;
import com.github.javaparser.ast.visitor.VoidVisitorAdapter;
import com.github.javaparser.resolution.TypeSolver;
import com.github.javaparser.symbolsolver.JavaSymbolSolver;
import com.github.javaparser.symbolsolver.resolution.typesolvers.ReflectionTypeSolver;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class ObjectCreationExprParserTest {

    public static final String EXAMPLE = """
            class A {
                void dummy() {
                    ArrayList<String> list = new ArrayList<String>();
                }
            }
            """;

    @Test
    void parseObjectCreationTest() {
        TypeSolver solver = new ReflectionTypeSolver();
        ParserConfiguration parserConfiguration = new ParserConfiguration();
        parserConfiguration.setSymbolResolver(new JavaSymbolSolver(solver));
        JavaParser parser = new JavaParser(parserConfiguration);
        ParseResult<CompilationUnit> cu = parser.parse(EXAMPLE);
        cu.ifSuccessful(c -> c.accept(new VoidVisitorAdapter<Void>() {
            @Override
            public void visit(ObjectCreationExpr n, Void arg) {
                super.visit(n, null);
                System.err.println(n.getTypeAsString());
                assertEquals("ArrayList", n.getTypeAsString()); // is ArrayList<String>

                System.err.println(n.getTypeArguments());
                assertTrue(n.getTypeArguments().isPresent()); // is false
                assertEquals(1, n.getTypeArguments().get().size()); // is Optional.empty
                assertEquals("String", n.getTypeArguments().get().get(0));
            }
        }, null));
    }
}
```

